import './Birthday.css';


export default function Birthday(props) {
  const birthdayConstructor = (birthdayList) => {
    birthdayList.forEach(birthday => {
      return (`
        <h3>${birthday.date}</h3>
        <h3>${firstName}</h3>
        <h3>${lastName}</h3>`
      )
    });
  }
  return (
    <div className='Birthday-container'>
      ${birthdayConstructor(props.birthdayList)}
    </div>
  )
}
